function xprod(list,ix, row, res) {
	if(ix >= list.length) {
		res.push(row.slice());
		return res;
	}
	else {
		let ls = list[ix];
		if( !Array.isArray(ls)) {
			row[ix] = ls || '';
			xprod(list,ix+1, row, res);
